import axios from 'axios';
import { Component } from 'react';

class User extends Component {
  state = {
    User: [],
  };

  //method
  componentDidMount() {
    axios
      .get('http://localhost:4000/userall')
      .then((response) => {
        this.setState({
          User: response.data,
        });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    return (
      <>
        {this.state.User.map((val) => {
          return <></>;
        })}
      </>
    );
  }
}

export default User;
